import React from "react";
import Navbar from "../components/navbar";
import Announcement from "../components/announcement";
import Footer from "../components/Footer";
import "../style/Cart.scss";
function Cart() {
  return (
    <div className="Cart-container">
      <Navbar />
      <Announcement />
      <div className="Wraperr-cart">
        <h2 className="carttitle">cart</h2>
        <div className="top-cart">
          <button className="TopButton-cart" style={{}}>
            CONTINUE SHOPPING
          </button>
          <div className="TopTexts">
            <p className="TopText">Shopping Bag(2)</p>
            <p className="TopText">Your Wishlist (0)</p>
          </div>
          <button className="TopButton-cart">CHECKOUT NOW</button>
        </div>
        <div className="bottom-cart"></div>
      </div>
      <Footer />
    </div>
  );
}

export default Cart;
